        super(props);
        this.state = {
            seasonResult: []
            /*seasonId: '',
            className: '',
            seasonImg: ''*/
        }
    }

    componentDidMount = async () => {
        await this.getSeasonIdList();
    }

    getSeasonIdList = () => {
        const proxyurl = "https://cors-anywhere.herokuapp.com/";
        const getSeasonIdDetail = 'https://static.api.nexon.co.kr/fifaonline4/latest/seasonid.json';
        const seasonIdArray = [];

        axios.get(proxyurl + getSeasonIdDetail).then(response => {
            seasonIdArray.push(response.data);
            let data = response.data;
            console.log("data-->", data);

            //for(let i in data){
                //console.log("i-->", i);

                this.setState({
                    seasonResult: data
                   /* seasonId: response.data[i].seasonId,
                    className: response.data[i].className,
                    seasonImg: response.data[i].seasonImg*/
                });
            //}
        })
    }

    render() {
        console.log("this:", this.state.seasonResult[0].seasonId);

        return (
            /*<Profile seasonResult={this.state.seasonResult}/>*/
           /* <span>"테스트"</span>*/
            <div className="seasonList">
               {/* {this.state.seasonResult.map((season, index)  => {
                    return (<div>{this.state.seasonResult[index].seasonId}</div>)
                })}*/}
                시즌 아이디: {this.state.seasonResult[0].seasonId}
            </div>
        );
    }
}

export default SeasonList;
